window.bookSummaryJSON = "<p>He's your perfect date. You're his next victim. </p> <p>When the tortured body of a young woman is found in a dumpster, her eyes swollen shut and her clothes soaked with blood, detective Erika Foster is one of the first at the crime scene. The trouble is, this time it's not her case. </p> <p>While she fights to secure her place on the investigation team, Erika can't help but get involved and quickly finds a link to the unsolved murder of a woman four months earlier. Dumped in a similar location, both women have identical wounds - a fatal incision to the femoral artery. </p> <p>Stalking his victims online, the killer is preying on young pretty women using a fake identity. How will Erika catch a murderer who doesn't seem to exist? </p> <p>Then another girl is abducted while waiting for a date. Erika and her team must get to her before she becomes another dead victim and come face to face with a terrifyingly sadistic individual. </p> <p>Gripping, tense, and impossible to turn off, <i>Last Breath</i> will have you on the edge of your seat until the final dramatic moment. </p>"; 
